'Debugging can be used for troubleshooting. If you turn it on, the system will log every action to your History log. You can use these messages to investigate the flow of commands, and to find out what is wrong. This way you can check what are the scripts doing and where exactly they fail. In production it should be turned off, because it generates multiple history records for each transaction and slows down the system.'=>'Режим налагодження можна використовувати для пошуку і усунення несправностей. Коли Ви його дозволите, система буде записувати кожну дію в журнал подій. Ви можете використовувати ці записи для перевірки потоку команд і з\'ясування, що працює не так як треба. Так Ви зможете перевірити, що роблять скрипти і де вони не спрацьовують. У працюючому сайті цей режим повинен бути відключений, тому що він створює численні записи в журналі для кожної транзакції і уповільнює роботу системи.',
