'Hosting of %s on  %s servers.'=>'Хостінг %s на серверах %s',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Кілька валют дозволить вам відслідковувати продажі в різних валютах.<br/><a href="%s" target="_blank">Додаткова інформація в нашій Бази Знань</a>',
'Multiple merchants'=>'Кілька продавців',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'За замовчуванням, всі кампанії у %s є відкритими, що означає, що всі партнери можуть переглядати і просувати їх. Особливість приватних кампаній дозволяє створювати приватні кампанії, які буде видно лише обраним партнерам.<br/><a href="%s" target="_blank"> Додаткова інформація в нашій Базі Знань</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Це дозволює створювати особливий тип промо-матеріалів - ребрендовані електронні книги. Ви можете створити свою електронну книгу у PDF форматі тільки один раз і завантажити її на %s. Ваши партнери автоматично отримають свії власні ребрендовані примірники книги, з їх назвами, партнерськими посиланнями, текстом і т.д. Не потрібно запускати ніякої Windows програми для ребрендингу, вони будуть просто завантажувати вже ребрендований PDF. Весь ребрендинг робиться автоматично у фоновому режимі.<br/><a href="%s" target="_blank">%s</a>',
